select  distinct 
loc_bldg_cd,
Req_Status,
requisition_guid,
icims_req_id,
desired_strt_dt,
ntrnl_job_title,
job_title,
job_title_nm,
loc_cty_nm,
--loc_cntry_nm, mike`s update
case when loc_cntry_nm = 'GBRSC' then 'UK' when loc_cntry_nm = 'ROI' then 'IE'  when loc_cntry_nm='GBR' then 'UK' else local_codes.iso_alpha_2_code end as loc_cntry_nm,
Recruiter_Name ,
Recruiter_ID ,
HM_Name ,
HM_ID ,
empl_class_nm,
job_lvl_nm ,
job_title_descr ,
op_budget_yr,
Hire_Type,
schedule_type_id,
confidential,
--rgltry_rgn_cd, mike`s update
case when rgltry_rgn_cd = 'GBRSC' then 'UK' when rgltry_rgn_cd = 'ROI' then 'IE' when rgltry_rgn_cd='GBR' then 'UK' else regional_codes.iso_alpha_2_code end as rgltry_rgn_cd,
job_cd,
job_tech_in ,
full_part_nm,
approved_for_agencies ,
dept_id,
cost_type_id ,
jobcode_comp_frequency_descr,
req_opened_dt ,
req_aprvd_dt ,
(case icims_req_id  when 'NUL' then 0
else 1
end) as req_approved,
job_function_desc,
job_family_desc,
Sourcer_ID ,
Sourcer_Login ,
req_age ,
just.JUSTIFICATION,
LOC_ST_NM ,
countfilled,
countoffered as count_on_offer,
employee_being_replaced,
openings,
vacancies_left,
vacancies_minus_offers,
inscreen,
inpanel,
inps,
inapplied


from


(with hrbi as
(
select 
candidate_icims_id, 
icims_req_id, 
Correct_Current_State,

sum(
(case 
when Correct_Current_State LIKE '%Resume Review%' then 1 
when Correct_Current_State LIKE '%Evaluation%' then 1 
when Correct_Current_State LIKE 'IH CANCELED' then 1 
else 0 end)) as In_Screening,

sum(
(case 
when Correct_Current_State LIKE '%PS1%' then 1 
else 0 end)) as In_PS,

sum((case 
when Correct_Current_State LIKE '%Debrief%' then 1 
when Correct_Current_State LIKE '%Inhouse Interview%' then 1

else 0 end)) as In_Panel,
0 as in_Applied

/* adding applicant tagged to in_applied instead of --0 as in_Applied
sum((case 
when Correct_Current_State LIKE '%APPLICANT%' then 1 
else 0 end)) as in_Applied */


from hrmetrics.job_pipeline_data
/* this where clause was to restrictive, also there's rejection in correct_current_state
where concat(icims_req_id, candidate_icims_id) NOT IN 
--(select concat(job_amzr_req_id, person_system_id) from hrmetrics.wbr_hisorical_snapshot_data where step LIKE '%Rejected%')
(select concat(job_id, person_id )--or icims_id
from hrmetrics.dynamo_worksteps_latest
where status like '%Rejected%'
)
*/
where correct_current_state not like '%Rejection%'

group by icims_req_id,candidate_icims_id,Correct_Current_State

),

icims as 
(
select job_id, person_id, sum(In_Screening) as In_Screening, sum(In_Panel) as In_Panel, sum(In_PS) as In_PS, sum(In_Applied) as In_Applied, status
--select job_amzr_req_id, person_system_id, sum(In_Screening) as In_Screening, sum(In_Panel) as In_Panel, sum(In_PS) as In_PS, sum(In_Applied) as In_Applied
from 
(
select job_id, person_id, status,
(case
when status like '%Hire%' then 0 -- this also affect move candidate to amazon hire status 
WHEN status LIKE '%Candidate - Offer - Accepted%' THEN 0
WHEN status LIKE '%Candidate - Offer - MRT - Offer Accepted%' THEN 0
WHEN status LIKE '%Internal Transfer - Offer Accepted%' THEN 0
WHEN status LIKE '%Candidate - Interview Process - On-Campus Interview%' THEN 1
WHEN status LIKE '%Candidate - Interview Process - Interview Pending%' THEN 1
WHEN status LIKE '%Internal Transfer - Prepare Offer%' THEN 1
WHEN status LIKE '%Candidate - Interview Process - Flyback Pending%' THEN 1
WHEN status LIKE '%Candidate - Interview Process - Interview%' THEN 1
WHEN status LIKE '%Candidate - Interview Process - Schedule Campus Interview%' THEN 1
WHEN status LIKE '%Candidate - Offer - Approved%' THEN 1
WHEN status LIKE '%Candidate - Interview Process - Schedule Interview%' THEN 1
WHEN status LIKE '%Candidate - Interview Process - Schedule Event Interview%' THEN 2
WHEN status LIKE '%Candidate - Interview Process - Debrief%' THEN 1
WHEN status LIKE '%Candidate - Offer - Requested%' THEN 1
WHEN status LIKE '%Candidate - Interview Process - Interview Rescheduling%' THEN 1
WHEN status LIKE '%Candidate - Interview Process - Flyback%' THEN 1
WHEN status LIKE '%Candidate - Offer - Requested%' THEN 1
WHEN status LIKE '%Internal Transfer - Offer Confirmation Request%' THEN 1
WHEN status LIKE '%Candidate - Interview Process - Event Interview%' THEN 1
--WHEN status LIKE '%On-site%' THEN 1
--WHEN status LIKE '%On-Site%' THEN 1
--WHEN status LIKE '%Panel%' THEN 1
else 0 end) as In_Panel,

(case 
--when status LIKE '%Hire%' then 0
when status LIKE '%Recruiter Review%' then 1
when status LIKE '%Hiring Manager Review%' then 1
when status LIKE '%Assessment%' then 1
when status LIKE '%Work Sample%' then 1
when status LIKE '%Testing%' then 1
when status LIKE '%Candidate - Interview Process - ART - Tagged%' then 1
when status LIKE '%HM review%' then 1
--when status LIKE '%Move Candidate to Amazon Hire%' then 1
else 0 end) as In_Screening,

(case 
--when status LIKE '%Hire%' then 0
when status LIKE '%Schedule Phone Screen%' then 1 
when status LIKE '%Phone Screen Rescheduling%' then 1 
when status LIKE '%2nd Phone Screen Pending%' then 1 
when status LIKE '%Phone Screen%' then 1 
when status LIKE '%Schedule 2nd Phone Screen%' then 1 
when status LIKE '%Phone Screen Complete - HM Action Required%' then 1 
when status LIKE '%Phone Screen Pending%' then 1 
when status LIKE '%Video%' then 1
when status LIKE '%Phone%' then 1
else 0 end) as In_PS,

(case 
--when status LIKE '%Hire%' then 0
when status LIKE '%Email Submission%' then 1 
when status LIKE '%Internal Transfer%' then 1 
when status LIKE '%External Career Site%' then 1 
when status LIKE '%Vendor Submission%' then 1 
when status LIKE '%Employee Referral%' then 1 
when status LIKE '%SourcePoint%' then 1 
when status LIKE '%Employee Referral - Pending Processing%' then 1 
when status LIKE '%Schedule Candidate%' then 1 
when status LIKE '%INTRF - Eligibility Exception Requested%' then 1 
when status LIKE '%Hiring Manager Submission%' then 1
when status LIKE '%Recruiter Submission%' then 1
when status LIKE '%INTRF - Eligibility Check%' then 1
when status LIKE '%INTRF - Eligiblity Check Service%' then 1
--when status LIKE '%Incomplete%' then 1
else 0 end) as In_Applied

from hrmetrics.dynamo_worksteps_latest
--hrmetrics.wbr_hisorical_snapshot_data
--where job_id in ('584613','584287','584288','581134')
)
group by 
job_id
,person_id
,status
),

a4 as --cost center mapping
(select cost_center, biz_area from hrmetrics.cost_center_mapping cc
), 

a2 as --offers from wstl
(--updating countoffered calculation to pull from dynamo_worksteps_latest because wbr_hisorical_snapshot_data has not been loaded for weeks
select distinct job_id
, count(job_id) as countoffered 
from hrmetrics.dynamo_worksteps_latest-- change this to wst latest
where status IN ('Candidate - Offer - Extended','Internal Transfer - Offer Sent','Candidate - Offer - Requested')
group by job_id
/*select distinct job_amzr_req_id, count(job_amzr_req_id) as countoffered from hrmetrics.wbr_hisorical_snapshot_data -- change this to wst latest
where step IN ('Extended','Offer Sent','Requested')
group by job_amzr_req_id*/
),

a1 as --countfilled
(select distinct job_id
, count(job_id) as countfilled
from hrmetrics.dynamo_worksteps_latest
where status in 
('%Hire Confirmed%','%Error - Prepare for Hire%', '%Prepare for Hire%', 'Accepted','Offer Accepted''Candidate - Offer - Accepted','Candidate - Pre-hire - Error - Prepare for Hire','Candidate - Pre-hire - Prepare for Hire','Employee - CW Hire Confirmed','Employee - Hire Confirmed','Internal Transfer - Offer Accepted','Temp/Contractor - Hire Confirmed','Candidate - Pre-hire - Approved For Hire - FC','Candidate - Offer - MRT - Offer Accepted')
group by job_id
/*
select distinct job_amzr_req_id, count(job_amzr_req_id) as countfilled from hrmetrics.wbr_hisorical_snapshot_data -- change this to wst latest
where step IN ('Hire Confirmed','Error - Prepare for Hire', 'Prepare for Hire', 'Accepted','Offer Accepted') --added accepted offer stage
group by job_amzr_req_id*/
),

a3 as( --hrmetrics.historical_job_data jobs

select
requisition_id,
icims_req_id,
requisition_guid ,
desired_strt_dt,
op_budget_yr,
ntrnl_job_title,
confidential,
loc_bldg_cd,
loc_cty_nm,
loc_cntry_nm,
rgltry_rgn_cd,
job_cd,
job_title_nm ,
job_lvl_nm ,
job_tech_in ,
empl_class_cd ,
job_apprvd,
empl_class_nm,
job_title,
full_part_nm,
job_function_desc,
job_family_desc,
rc_group,
job_posting_description,
schedule_type_id,
approved_for_agencies ,
employee_being_replaced ,
(SUBSTRing(dept_id,0,5)) as dept_id,
cost_type_id ,
jobcode_comp_frequency_descr ,
JUSTIFICATION,
LOC_ST_NM ,
req_opened_dt ,
req_aprvd_dt ,
curnt_trans_flag ,
job_title_descr ,
Recruiter_Name ,
Recruiter_ID ,
Req_Status ,
HM_Name ,
HM_ID ,
HM_login ,
Sourcer_Name ,
Sourcer_ID ,
Sourcer_Login ,
req_age ,
HMlogin3 ,
HMlogin4 ,
HMlogin5 ,
HMlogin6 ,
HMlogin7 ,
HMlogin8 ,
HMlogin9 ,
HMlogin10,
HMlogin11 ,
HMlogin12 ,
HMlogin13 ,
HMlogin14 ,
HMlogin15,
Hire_Type,
openings,
a1.countfilled,


(case a1.countfilled when NULL then
openings

else
(NVL(openings,0) - NVL(a1.countfilled,0))

end) as Vacancies_Left


from hrmetrics.historical_job_data jobs

left join a1 --countfilled
ON jobs.icims_req_id = a1.job_id

--where UPPER(req_status) NOT IN ('FILLED')
) 

select *,
(case a2.countoffered when NULL then
a3.Vacancies_Left

else
(NVL(a3.Vacancies_Left,0) - NVL(a2.countoffered,0))

end) as Vacancies_Minus_Offers

from A3  

LEFT JOIN A2

ON a3.icims_req_id = a2.job_id

left join A4 

ON a3.dept_id =  a4.cost_center
  

left join --union icims hrbi
(
  select ICIMS_Req, SUM(In_Screen) as InScreen, SUM(In_Panel) as InPanel, SUM(In_PS) as InPS, sum(In_Applied) as InApplied  from
  (
    select cast(icims.person_id as varchar (40)) as ICIMS_Person, cast(icims.job_id as varchar(40)) as ICIMS_REQ, icims.In_Screening as In_Screen, icims.In_Panel as In_Panel, icims.In_PS, icims.In_Applied from icims 
    union 
    select hrbi.candidate_icims_id as HRBI_Person, hrbi.icims_req_id  as HRBI_Req, hrbi.In_Screening as HRBI_Screen, hrbi.In_Panel, hrbi.In_PS as HRBI_Panel, hrbi.In_Applied as HRBI_Applied from hrbi 
  )
  group by ICIMS_Req
)
ON a3.icims_req_id  = ICIMS_REQ)
-- region and country code mapping
LEFT OUTER JOIN hrmetrics.country_codes regional_codes 
on rgltry_rgn_cd = regional_codes.iso_alpha_3_code

LEFT OUTER JOIN hrmetrics.country_codes local_codes
on loc_cntry_nm = local_codes.iso_alpha_3_code

LEFT JOIN (select distinct job_art_job_id, justification from hrmetrics.art_jobs) just on just.job_art_job_id = requisition_guid
where req_status != 'ELIMINATED'
and op_budget_yr > 2013
